void SpriteCodex::DrawNumber(Graphics& gfx, Vec2& pos, Color c, int n)
{
	switch (n)
	{
	case 0:
		Draw0(gfx, pos, c);
		break;
	case 1:
		Draw1(gfx, pos, c);
		break;
	case 2:
		Draw2(gfx, pos, c);
		break;
	case 3:
		Draw3(gfx, pos, c);
		break;
	case 4:
		Draw4(gfx, pos, c);
		break;
	case 5:
		Draw5(gfx, pos, c);
		break;
	case 6:
		Draw6(gfx, pos, c);
		break;
	case 7:
		Draw7(gfx, pos, c);
		break;
	case 8:
		Draw8(gfx, pos, c);
		break;
	case 9:
		Draw9(gfx, pos, c);
		break;
	}
}

